My EP 🖤 @thisiswatt you are a ROCK GOD. Your steadfast belief in my artistry is fueling the rocket we’re taking out of this fucking atmosphere! 10 years of memories behind us and a fuck ton more to make ahead! I won’t take a second we’re together for granted. To watch you work is astonishing. Cheers to the dude who has Bieber at 2 and Metallica at 7 (and squeezes me in somewhere between) 🤘🏼🎸 

@iammarkronson I am never going to quite comprehend how you manage to make songs sound so classic and fucking next level new simultaneously! You are a wizard! Thankful for the past few years we’ve spent making art together and looking forward to many more. You’re my hero. 

@wyattish is responsible for the most intimate and personal song on the entire record Golden G String.... you see me.... you hear me , you’re there when i need you most. I am grateful. Love u. #Cattitude 

Thank you to my momager @tishcyrus & my team at @rcarecords @maverick @adamleber @adrianaarce_ @oliviarudensky my creative angels @therealmickrock @lilmami_lani @vijatm @bradleykennetheyewear
